'''Braden Overett''' (born November 20, 1981 in [[New York, New York]]) is an American [[figure skater]] and choreographer. He is the 2003 U.S. Collegiate Champion.
He won the 2007 Paul McGrath Choreographer of the Year Award for his self-choreographed long program in the 2006/2007 season to Pirates of the Caribbean.<ref>[http://www.usfigureskating.org/Story.asp?id=38741 Welcome to U.S. Figure Skating<!-- Bot generated title -->]</ref> He choreographs his own programs, as well as the programs of other competitive skaters.
